{
  "Case Importance": "2",
  "Summary": "The applicant, a Turkish national, was convicted for disseminating propaganda in favor of the MLKP, an illegal armed organization, due to her participation in a demonstration on International Workers' Day. She was sentenced to ten months' imprisonment, with the pronouncement of her conviction suspended on the condition that she did not commit another intentional offense for five years. The applicant claims violations of her rights to freedom of expression and assembly under Articles 10 and 11 of the Convention.",
  "Reasoning": "The case is of medium importance as it involves the application of existing case law regarding freedom of expression and assembly in the context of anti-terrorism laws. While it does not make a significant contribution to the development of case law, it goes beyond merely applying existing case law by addressing the balance between national security concerns and individual rights."
}

{
  "Case Importance": "1",
  "Summary": "The application concerns the deportation of the applicants’ family members by the Montenegrin authorities to the authorities of Republika Srpska in Bosnia and Herzegovina in May 1992, where they were later killed or went missing. The applicants complain, under procedural limb of Articles 2 and 3, about a lack of an effective investigation into the impugned event.",
  "Reasoning": "The case is of high importance as it involves serious allegations of human rights violations, including the right to life and protection from torture and inhuman or degrading treatment. The case also questions the effectiveness and independence of the investigation conducted by the domestic authorities, which could significantly contribute to the development, clarification, or modification of case law regarding state obligations under Articles 2 and 3 of the Convention."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, Mr. Mihai Basturea, a Romanian national, complains of inhuman and degrading treatment in Poarta Albă Prison and Prison Hospital due to overcrowding, poor hygiene, lack of adequate medical treatment, and inadequate facilities for disabled persons.",
  "Reasoning": "The case raises significant issues regarding the treatment of disabled prisoners and the adequacy of prison conditions, which could contribute to the development, clarification, or modification of case law concerning Article 3 of the Convention. The case addresses systemic issues within the prison system that may have broader implications for the rights of detainees, particularly those with disabilities."
}

{
  "Case Importance": "1",
  "Summary": "The applicants, Mr. Mykola Demyanovych Khadzhyradov and Ms. Vira Petrivna Khadzhyradova, are the parents of the late Mr. Demyan Mykolayovych Khadzhyradov, who died in prison in 2007. They allege that their son, who was suffering from HIV and tuberculosis, did not receive adequate medical care in prison and that the authorities delayed his release on health grounds, leading to his death.",
  "Reasoning": "This case is of high importance as it raises significant issues regarding the right to life under Article 2 of the Convention, particularly in the context of the treatment of prisoners with serious health conditions. The case could contribute to the development and clarification of case law concerning the obligations of state authorities to provide adequate medical care to detainees and to act with due diligence in processing requests for release on health grounds."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, Mr. Iurie Craciuneac, a Moldovan national, alleges severe ill-treatment by police officers following his participation in a protest against alleged electoral fraud in Chişinău on 6 and 7 April 2009. He claims to have been beaten, forced to strip naked, and subjected to inhuman and degrading conditions of detention. He also complains about the lack of medical assistance and food during detention, and the failure of the authorities to conduct an effective investigation into his allegations.",
  "Reasoning": "This case is of high importance as it involves serious allegations of police brutality and the failure of the state to conduct an effective investigation into these claims. The case raises significant issues under Article 3 (prohibition of torture and inhuman or degrading treatment) and Article 13 (right to an effective remedy) of the European Convention on Human Rights. The outcome of this case could contribute to the development and clarification of the Court's case law on state obligations to prevent and investigate ill-treatment by law enforcement authorities."
}

{
  "Case Importance": "2",
  "Summary": "The applicant, Mr. Ali Özdemir, a Turkish national, was convicted of possessing an unregistered firearm and fined. When he failed to pay the fine, the court converted it into a prison sentence without notifying him or holding a hearing. He was subsequently arrested and detained. The applicant claims violations of his rights under Articles 5 and 6 of the European Convention on Human Rights, including the right to a fair trial and the right to liberty.",
  "Reasoning": "The case goes beyond merely applying existing case law as it raises significant issues regarding procedural fairness and the right to liberty under Articles 5 and 6 of the Convention. The case involves the conversion of a fine into imprisonment without proper notification or a hearing, which could contribute to the development or clarification of case law in this area."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, Mr. Jerome Colloredo-Mansfeld, a Czech national, is involved in restitution proceedings concerning movable property confiscated during the German occupation of Czechoslovakia and later by the Czechoslovak State. The case revolves around whether the property was taken before or after the critical date of 25 February 1948, which determines the applicability of restitution laws. The applicant claims violations of his right to a fair trial and peaceful enjoyment of possessions.",
  "Reasoning": "The case is of high importance because it addresses significant issues related to the restitution of property confiscated during and after World War II, the interpretation of restitution laws, and the principles of a fair trial. The outcome could have a substantial impact on the development and clarification of case law concerning property restitution and procedural fairness in the context of historical injustices."
}

{
  "Case Importance": "1",
  "Summary": "The case involves a Brazilian national residing in Bulgaria who has been engaged in prolonged legal battles over the custody of her children and the right to travel abroad with them. Despite a final court decision granting her custody, the father has retained the children and obstructed their return. The case also includes issues of domestic violence allegations and enforcement difficulties.",
  "Reasoning": "The case is of high importance as it addresses significant issues related to the enforcement of custody decisions, the right to family life under Article 8 of the Convention, and the procedural delays in judicial proceedings. These issues contribute to the development and clarification of case law concerning the protection of family rights and the effectiveness of judicial enforcement mechanisms."
}

{
  "Case Importance": "2",
  "Summary": "The application concerns the applicant’s right not to be tried or punished twice for the same offence. In criminal proceedings, the applicant was found guilty of bodily injury and sentenced to two months’ imprisonment, suspended for one year. In minor-offence proceedings regarding the same incident, the applicant was found guilty of causing and participating in a fight and was imposed a fine of 300 euros (EUR). The applicant, relying on Article 6 of the Convention, complains that he has been convicted twice for the same offence.",
  "Reasoning": "The case is of medium importance because it addresses the issue of double jeopardy under Article 4 § 1 of Protocol No. 7 to the Convention. While it does not make a significant contribution to the development of case law, it goes beyond merely applying existing case law by examining the specific circumstances of the applicant's convictions and their compliance with the Convention."
}

{
  "Case Importance": "3",
  "Summary": "The applicant, Mr. Toni Sedlovski, a Macedonian national, complains that the Supreme Court's rejection of his appeal on points of law deprived him of his right of access to the court. The case involves a civil dispute over the value of a shared property with his former wife, which was initially set at MKD 1,000,000 but later contested.",
  "Reasoning": "The case appears to be of limited interest as it primarily concerns the application of existing case law regarding procedural aspects of civil disputes and access to higher courts. It does not seem to make a significant contribution to the development, clarification, or modification of case law."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, Mr. Barış Demir, a Turkish national and conscript soldier, suffered a severe injury to his left arm during military training, which was exacerbated by inadequate medical treatment, leading to the amputation of his arm. He alleges medical negligence and inadequate investigation by military authorities, and challenges the fairness and impartiality of the Supreme Military Administrative Court.",
  "Reasoning": "This case is of high importance as it addresses significant issues related to the treatment of conscript soldiers, medical negligence, and the adequacy of military judicial processes. The case has the potential to contribute to the development and clarification of case law concerning the rights of conscript soldiers, the standards of medical care in military settings, and the independence and impartiality of military courts."
}

{
  "Case Importance": "2",
  "Summary": "The applicant, Mr. Anurbiy Mukhadinovich Blenaov, a Russian national, complains that the domestic courts ordered his eviction from his only home in breach of domestic law and without examining his arguments against the eviction. The case involves the interpretation of property rights and the right to respect for one's home under Article 8 of the Convention.",
  "Reasoning": "The case is of medium importance (2) because it goes beyond merely applying existing case law. It involves significant issues related to property rights, eviction, and the right to respect for one's home under Article 8 of the Convention. However, it does not make a significant contribution to the development, clarification, or modification of case law to the extent that it would be considered of high importance or a key case."
}

{
  "Case Importance": "2",
  "Summary": "The applicants, employees of company T., brought a civil action in the Zagreb Municipal Court in 1984 seeking payment of salary arrears in USD. The case went through multiple rounds of judgments and appeals, with the final decision being made by the Supreme Court, which declared the applicants' appeals inadmissible without providing adequate reasons. The applicants complain under Article 6 § 1 of the Convention that their right to a fair hearing was violated.",
  "Reasoning": "The case is of medium importance (2) because it involves the application of existing case law regarding the right to a fair hearing under Article 6 § 1 of the Convention. While it does not make a significant contribution to the development of case law, it goes beyond merely applying existing case law by addressing the issue of the adequacy of reasons provided by the Supreme Court for declaring appeals inadmissible."
}

{
  "Case Importance": "1",
  "Summary": "The application concerns the interception and reading of the applicant’s emails by his public employer, the Serbian Statistics Office. These emails, sent from the applicant’s official account, contained personal and professional information, including comments on the state of affairs in the office. The emails were used as evidence in a civil defamation suit brought against the applicant by a colleague.",
  "Reasoning": "The case involves significant issues related to the right to privacy and freedom of expression under Articles 8 and 10 of the Convention. The interception and use of the applicant's emails by a public employer raise important questions about the limits of employer surveillance and the protection of personal correspondence. The case could contribute to the development, clarification, or modification of case law in these areas, making it of high importance."
}

{
  "Case Importance": "1",
  "Summary": "The application concerns the alleged violation of the applicant’s right not to be tried or punished twice for the same offence under Article 4 of Protocol No. 7 of the Convention. The applicant claims that the proceedings resulting in the imposition of tax surcharges constituted 'criminal proceedings' and that he was subsequently tried and convicted for aggravated tax offences, thus being tried or punished twice for the same offence.",
  "Reasoning": "The case addresses significant issues related to the interpretation and application of Article 4 of Protocol No. 7 of the Convention, specifically the principle of ne bis in idem (not being tried or punished twice for the same offence). The determination of whether tax surcharges constitute 'criminal proceedings' and whether the applicant was subjected to double jeopardy could have a substantial impact on the development and clarification of case law in this area. Therefore, the case is of high importance."
}

{
  "Case Importance": "3",
  "Summary": "The applicant instituted proceedings against a bank claiming overpaid interest. After a change in the relevant legislation, the bank offered the applicant recalculation of the interest, which the applicant accepted and the parties concluded an annex to the original loan agreement, whereby the matter was resolved. The applicant consequently withdrew his court action, claiming costs and expenses he had incurred in the proceedings thus far. The first-instance court awarded him the costs, but the County Court ultimately held that the applicant had withdrawn his action following a settlement and that hence each party was to bear its own costs. The applicant then filed an appeal on points of law with the Supreme Court and a constitutional complaint with the Constitutional Court, both of which were declared inadmissible. The applicant complains under Article 6 of the Convention and under Article 1 of Protocol No. 1 to the Convention, that the failure to reimburse him incurred costs of the proceedings in the circumstances had violated his right of access to a court as well as his property rights. He further complains: a) under Article 6 of the Convention about a violation of his right to legal certainty and the divergent case-law of the County Courts in identical cases to his own: he submitted a number of court decisions to show that in identical cases some County Courts awarded the costs sought, while others ordered each party to bear its own costs; b) under Article 14 of the Convention about discrimination in relation to those persons who had identical claims to his and who had been awarded reimbursement of their costs, and c) under Article 13 of the Convention that he had no effective remedy against the divergent case-law of the county courts, given that the Supreme Court declared his appeal on points of law inadmissible.",
  "Reasoning": "The case is of limited interest and simply applies existing case law. It does not make a significant contribution to the development, clarification, or modification of case law, nor does it go beyond merely applying existing case law. The issues raised are specific to the applicant's circumstances and do not have broader implications for the development of case law."
}

{
  "Case Importance": "2",
  "Summary": "The applicant, a former employee of Olympic Airways, resigned during the military dictatorship in Greece. Under Law No. 76/1974, she had the right to be reinstated if her resignation was forced. Despite multiple successful annulments of negative opinions regarding her reinstatement, the competent Minister has not complied with the final judgments ordering her reinstatement. The applicant complains under Article 6 § 1 of the Convention about the non-execution of these judgments and under Article 13 about the lack of an effective remedy.",
  "Reasoning": "The case is of medium importance (2) because it goes beyond merely applying existing case law. It addresses the issue of non-execution of domestic judgments, which is a significant concern in the context of the right to a fair trial under Article 6 of the Convention. However, it does not make a significant contribution to the development, clarification, or modification of case law to the extent that it would be considered of high importance or a key case."
}

{
  "Case Importance": "3",
  "Summary": "The applicant, Mr. Miroslav Samardžić, a Croatian national, lodged a civil action against his former employer, company T., claiming damages related to his previous employment. The Pula Municipal Court dismissed his action, and subsequent appeals to the Pula County Court, the Supreme Court, and the Constitutional Court were also dismissed or declared inadmissible. The applicant complains under Article 6 § 1 of the Convention that he did not have access to the Supreme Court.",
  "Reasoning": "The case appears to be of limited interest as it primarily involves the application of existing case law regarding procedural access to higher courts. It does not seem to make a significant contribution to the development, clarification, or modification of case law."
}

{
  "Case Importance": "1",
  "Summary": "The applicants, nineteen Afghani nationals, were apprehended by the Slovak Border and Foreigners Police near the Ukrainian border. They allege that they were not properly interviewed, were misidentified, and were not informed about the asylum procedure. They were issued administrative expulsion decisions and expelled to Ukraine the same day. The applicants claim their expulsion was collective and that they had no effective remedy to challenge it.",
  "Reasoning": "This case raises significant issues regarding the treatment of asylum seekers and the procedural safeguards in place for their protection. The allegations of collective expulsion without individual assessment and denial of access to asylum procedures could have a substantial impact on the development, clarification, or modification of case law related to the rights of asylum seekers and the obligations of states under the European Convention on Human Rights. Therefore, it is of high importance."
}

{
  "Case Importance": "1",
  "Summary": "The application concerns the alleged lack of an effective investigation into the death of the applicants’ son caused by a police officer. The applicant complains that he was denied access to the investigation file despite his repeated requests and that there were many deficiencies in the conducted investigation which did not allow for the establishment of the facts and circumstances surrounding his son’s death.",
  "Reasoning": "The case is of high importance as it involves the procedural obligation of the contracting States under Article 2 of the Convention to conduct an effective investigation when individuals have been killed as a result of the use of force. The case could make a significant contribution to the development, clarification, or modification of case law regarding the standards and requirements for effective investigations under Article 2, particularly in cases involving state actors such as police officers."
}

{
  "Case Importance": "1",
  "Summary": "The applicants, Bulgarian nationals, are contesting the non-restitution of a property expropriated in 1966, despite a 1998 Supreme Administrative Court judgment revoking the expropriation. The property remains occupied by the Plovdiv municipality and the '13 Centuries Bulgaria' National Endowment Fund. The applicants' rei vindicatio action was dismissed, with courts finding substantial renovation works and public use of the property as a cultural monument. The applicants allege violations of Article 6 § 1 and Article 1 of Protocol No. 1 of the Convention.",
  "Reasoning": "The case involves significant issues regarding the principles of legal certainty, the res judicata effect of final judgments, and property rights under the Convention. The Supreme Administrative Court's judgment and its subsequent disregard by lower courts, along with the involvement of public bodies, suggest a substantial impact on the development and clarification of case law in these areas."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, Mr. Dmitriy Yuryevich Belugin, a Russian national, alleges violations of his rights under Articles 3, 5, 6, and 13 of the European Convention on Human Rights. He claims he was subjected to inhuman treatment, denied legal assistance, and wrongfully convicted based on coerced confessions. The case involves issues of police misconduct, procedural rights during detention, and the fairness of the criminal trial.",
  "Reasoning": "The case raises significant issues regarding the treatment of detainees, the right to legal assistance, and the use of coerced confessions in criminal proceedings. These issues are crucial for the development and clarification of case law related to Articles 3, 5, and 6 of the Convention. The case has the potential to impact the standards for police conduct, detainee rights, and the admissibility of evidence obtained under duress, making it of high importance."
}

{
  "Case Importance": "2",
  "Summary": "The application concerns the quashing of a final judgment in favor of the applicant by the Supreme Court of Justice after accepting an appeal on points of law which was allegedly lodged outside the legal time-limit. The applicant complains that the quashing of the final judgment in such circumstances was contrary to the principle of legal certainty and breached his rights guaranteed by Article 6 § 1 and Article 1 of Protocol No. 1 to the Convention.",
  "Reasoning": "The case is of medium importance because it addresses the principle of legal certainty and the procedural fairness in the context of appeals, which goes beyond merely applying existing case law but does not make a significant contribution to the development, clarification, or modification of case law."
}

{
  "Case Importance": "2",
  "Summary": "The application concerns the applicant’s alleged ill-treatment following his arrest for public drinking and alleged resistance to police officers on 15 May 2017. An external visual examination of the applicant made upon his placement at the temporary detention centre following his arrest revealed small haematomas on his face and bruises and redness around the ribcage. An ambulance was called twice during the applicant’s twelve-hour detention at the centre. He was given painkillers. On 16 May 2017 the administrative-offence proceedings against the applicant resulted in a fine of 300 Georgian Laris (GEL, approximately 100 Euros (EUR)) for disobeying police orders. The relevant findings were based on the statements of the police officers who had arrested the applicant. On 17 May 2017 a criminal investigation was opened into the applicant’s complaint of ill-treatment with regard to Article 333 of the Criminal Code (exceeding official powers). On 18 May 2017 an X-ray revealed multiple fractures of the applicant’s ribs. The investigation is ongoing. The applicant complains under substantive and procedural aspects of Article 3 of the Convention.",
  "Reasoning": "The case is of medium importance. While it does not make a significant contribution to the case-law, it goes beyond merely applying existing case law. The case involves allegations of police misconduct and procedural inadequacies in the investigation of those allegations, which could have implications for the interpretation and application of Article 3 of the Convention."
}

{
  "Case Importance": "2",
  "Summary": "The applicant, Mr. Tomasz Pokrzywka, a Polish national, alleges that he was subjected to ill-treatment by police officers following an altercation at a hotel. He claims that he was beaten multiple times, resulting in significant injuries, including a ruptured testicle. The initial investigation by the prosecution authorities was discontinued, but it was later resumed following complaints. The subsequent investigation also concluded that the injuries were not caused by the police. The applicant contends that the use of force was disproportionate and that the investigation was superficial.",
  "Reasoning": "The case is of medium importance (2) because it involves allegations of police brutality and the adequacy of the investigation into such claims. While it does not make a significant contribution to the development of case law, it goes beyond merely applying existing case law by addressing the procedural aspects of investigating police misconduct and the standards required under Article 3 of the Convention."
}

{
  "Case Importance": "2",
  "Summary": "The application concerns the confiscation of the applicant’s alleged property (cash) as a result of criminal proceedings to which she was not a party. The applicant claims the cash in a bank’s safety deposit box, which was confiscated following the conviction of A.K. for a drug offence, belonged to her. She was not included in the criminal proceedings and found out about the confiscation after A.K.’s conviction. The domestic courts refused to examine her appeal challenging the attachment decision and her request to reopen the criminal proceedings. The Harju Country Court indicated that she could still lodge a claim against the State to assert her ownership of the money.",
  "Reasoning": "The case is of medium importance (2) because it raises significant issues regarding the procedural rights of third parties whose property is confiscated in criminal proceedings to which they are not a party. While it does not make a groundbreaking contribution to case law, it goes beyond merely applying existing case law by addressing the adequacy of legal remedies available to such third parties under Article 6 § 1 of the Convention."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, an organization registered in Moldova practicing Falun Gong, planned to organize two concerts of Chinese music and dance. The concerts were canceled following pressure from the Moldovan Government after a meeting with the Chinese ambassador, citing the preservation of good diplomatic relations with China. The applicant claimed breaches of its rights under Articles 10 and 11 of the Convention and sought compensation. The Supreme Court of Justice awarded minimal pecuniary damages without acknowledging any breach of Convention rights.",
  "Reasoning": "The case involves significant issues related to freedom of expression and assembly, as well as the influence of diplomatic relations on domestic legal decisions. The outcome could have a substantial impact on the development and clarification of case law concerning state interference in cultural and expressive activities, especially in the context of international diplomatic pressures."
}

{
  "Case Importance": "2",
  "Summary": "The applicant, Mr. Rado Antolović, a Slovenian national, complains that he was unable to effectively present his case regarding child maintenance payments due to not being informed of a decision on substitute child maintenance and an enforcement order. He argues that he had been making payments directly to his daughter's bank account, which the courts did not consider as fulfilling his obligation. He claims this deprived him of effective access to a court and that the evidence he proposed was unjustifiably rejected.",
  "Reasoning": "The case goes beyond merely applying existing case law as it involves the interpretation of procedural fairness and the right to a fair trial under Article 6 of the Convention. The case addresses whether the failure to inform the applicant of critical decisions and the rejection of his evidence without valid justification violated his rights. This could contribute to the development or clarification of case law regarding procedural rights and obligations in family law and maintenance cases."
}

{
  "Case Importance": "2",
  "Summary": "The applicant company, ATV Privatfernseh-Gmbh, a broadcasting company based in Vienna, aired a broadcast that included personal details about the then Minister for Health, Families and Youth, A.K., and her partner, P.I. P.I. filed a lawsuit under the Media Act, claiming that the broadcast violated his most intimate personal sphere by revealing details about his pending divorce and his relationship with A.K. The domestic courts ruled in favor of P.I., ordering the applicant company to pay compensation and publish the judgment. The applicant company complains that this ruling violates its right to freedom of expression under Article 10 of the Convention.",
  "Reasoning": "The case is of medium importance (2) because it involves the application of existing case law concerning the balance between freedom of expression and the right to privacy. While it does not make a significant contribution to the development of case law, it goes beyond merely applying existing principles by addressing the nuanced issue of reporting on private individuals associated with public figures."
}

{
  "Case Importance": "2",
  "Summary": "The applicant, Ms. Tetyana Vasylivna Kornilova, a Ukrainian national and Jehovah's Witness, was assaulted during a door-to-door religious visit. She alleges that the assault was motivated by religious hatred and that the authorities failed to properly investigate this aspect.",
  "Reasoning": "The case goes beyond merely applying existing case law as it involves the intersection of religious freedom, hate crimes, and the adequacy of state investigations into such matters. While it does not make a significant contribution to the development of case law on a broad scale, it addresses important issues of religious discrimination and the state's duty to investigate hate crimes, thus placing it at a medium level of importance."
}

{
  "Case Importance": "2",
  "Summary": "The application concerns compensation proceedings regarding the publication by the press of the applicant’s personal details (his initials, his age, his hometown, and his photograph with a black strip over his eyes) in relation to his arrest on suspicion of robbery. The relevant articles referred to information gathered in the course of the investigation against him and indicated that the applicant had committed the robbery. The investigation was eventually discontinued for lack of evidence. Although the Ohrid Court of First Instance granted, in part, the applicant’s compensation claim against the Ministry of the Interior, the Bitola Court of Appeal overturned that judgment and dismissed the applicant’s claim. It found that under the relevant domestic law the applicant was not entitled to claim compensation from the Ministry and that there was no evidence that the police had released the information to the press. That court further held that the applicant was entitled to claim compensation from the media that published the articles. The Supreme Court upheld the second-instance judgment.",
  "Reasoning": "The case is of medium importance as it goes beyond merely applying existing case law. It addresses significant issues related to the presumption of innocence under Article 6 § 2 and the right to respect for private life under Article 8 of the Convention. The case does not make a significant contribution to the development, clarification, or modification of case law to be considered of high importance, but it does involve important considerations regarding the balance between public interest and individual rights."
}

{
  "Case Importance": "1",
  "Summary": "The application concerns the alleged ill-treatment of a Pakistani migrant by Hungarian law enforcement officers and the inadequacy of the ensuing investigations. The applicant entered Hungary illegally from Serbia on 11 August 2016 and was apprehended and returned to Serbia the next day. During the removal operation, the applicant and other migrants were allegedly physically assaulted by Hungarian officers, resulting in various injuries to the applicant. The investigation into these allegations was terminated by the Chief Public Prosecutor’s Office on 9 February 2018.",
  "Reasoning": "The case is of high importance because it involves allegations of inhuman or degrading treatment by state authorities, which could significantly impact the development, clarification, or modification of case law regarding the treatment of migrants and the adequacy of investigations into such allegations. The case raises serious questions under Article 3 of the Convention, both in terms of substantive and procedural protections."
}

{
  "Case Importance": "2",
  "Summary": "The application concerns an alleged act of medical negligence within the context of a suicide during a period of voluntary hospitalisation in a State hospital. The applicants lodged a civil action against the hospital seeking pecuniary and non-pecuniary damages of 63,523 euros. The domestic courts ruled against the applicants. The applicants complain under the substantive limb of Article 2 that the hospital knew or ought to have known that M.R., their mother and spouse, posed a real and immediate risk of suicide and that it failed to take reasonable measures to prevent that risk.",
  "Reasoning": "The case is of medium importance as it involves the application of existing case law regarding the State's obligations under Article 2 of the Convention in the context of medical negligence and suicide risk. While it does not make a significant contribution to the development of case law, it goes beyond merely applying existing case law by addressing specific circumstances related to voluntary hospitalisation and the duty of care owed by medical institutions."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, L.F., an Irish national, underwent a symphysiotomy in 1963 without her informed consent. She claims long-term physical and psychological harm from the procedure. The case involves the broader context of the use of symphysiotomies in Ireland, which were performed in some hospitals until the mid-1980s, often influenced by religious and socio-economic factors. The applicant's civil action for damages was dismissed as statute-barred, and she argues that there has been no independent investigation into the practice.",
  "Reasoning": "This case is of high importance because it addresses significant issues related to medical ethics, patient consent, and the long-term impact of medical procedures. It also involves broader socio-cultural and religious factors influencing medical practices in Ireland. The case has the potential to contribute to the development and clarification of case law regarding state obligations to investigate historical medical practices and provide remedies for victims."
}

{
  "Case Importance": "1",
  "Summary": "The applicant, Ms A.E., a Bulgarian national, alleges that she was subjected to domestic violence by her partner, D.M., and that the Bulgarian authorities failed to investigate her complaints adequately. The case involves issues of domestic violence, the effectiveness of legal protections for minors, and gender-based discrimination.",
  "Reasoning": "This case is of high importance because it addresses significant issues related to the protection of minors and victims of domestic violence, the adequacy of legal frameworks, and the state's obligations under Article 3 and Article 14 of the Convention. The case could contribute to the development, clarification, or modification of case law concerning the state's positive obligations to protect individuals from domestic violence and ensure non-discrimination."
}

{
  "Case Importance": "1",
  "Summary": "The applicants, Mr. Máté Szabó and Ms. Beatrix Vissy, are Hungarian nationals who challenge the sweeping prerogatives of the Anti-Terrorism Task Force (TEK) under section 7/E (3) of the Police Act, which allows for secret surveillance without judicial control. They argue that this infringes their constitutional right to privacy and lacks sufficient external oversight.",
  "Reasoning": "The case raises significant issues regarding the balance between national security measures and individual privacy rights. It questions the adequacy of oversight mechanisms for secret surveillance authorized by the Minister of Justice, rather than a judicial body. The outcome could have a substantial impact on the development and clarification of case law concerning privacy rights and state surveillance, making it of high importance."
}

{
  "Case Importance": "2",
  "Summary": "The application concerns the establishment of paternity based on DNA testing methods which became available only many years after the issue had seemingly already been resolved. Specifically, by 1971 the applicant’s purported biological father obtained a final court ruling to the effect that there was insufficient evidence to conclude that the applicant was indeed his son. The applicant who had been born in 1969, however, apparently only became aware of this judgment in 2012, following his “father’s” death, and shortly thereafter sought the reopening of the said civil proceeding in order to definitively establish paternity by means of DNA testing, a method which had become available in the meantime but required a court order. Ultimately, by 23 January 2014, regular courts at two instances and the Constitutional Court all ruled against the applicant, referring to a lack of procedural basis for the requested reopening.",
  "Reasoning": "The case is of medium importance. While it does not make a significant contribution to the case-law, it goes beyond merely applying existing case law by addressing the issue of reopening paternity cases based on new DNA testing methods, which could have implications for similar future cases."
}

{
  "Case Importance": "2",
  "Summary": "The applicant, Mr. Henrikas Jankovskis, a Lithuanian national, is currently detained in Pravieniškės prison. He complains about the refusal of internet access, denial of extended visits, and the conditions of his detention. The courts upheld the prison authorities' decisions, citing security concerns and the lack of legal provisions allowing internet access for prisoners.",
  "Reasoning": "The case is of medium importance as it addresses the application of existing case law regarding prisoners' rights and the limitations imposed by prison authorities. While it does not make a significant contribution to the development of case law, it goes beyond merely applying existing case law by examining the balance between security concerns and prisoners' rights to information and family visits."
}

{
